	DealPlyCls.prototype.getArrayAsString = function(arr, level) {
		var dumped_text = "";
		if (!level)
			level = 0;

		var level_padding = "";
		for ( var j = 0; j < level + 1; j++)
			level_padding += "    ";

		if (typeof (arr) == 'object') {
			for ( var item in arr) {
				var value = arr[item];

				if (typeof (value) == 'object') { // If it is an array,
					dumped_text += level_padding + "\"" + item + "\" : {\n";
					dumped_text += DealPly.getArrayAsString(value, level + 1);
					dumped_text += level_padding + "}\n";
				} else {
					dumped_text += level_padding + "\"" + item + "\" : \""
							+ value + "\"\n";
				}
			}
		} else {
			dumped_text = "===>" + arr + "<===(" + typeof (arr) + ")";
		}
		return dumped_text;
	};

