	/**
	 * 
	 */
	DealPlyCls.prototype.reportHeartBit = function() {
		if (DealPly.isPersistentPropertySupported() === false) {
			return;
		}

		if (DealPly.getPersistentId() === null
				|| DealPly.getPersistentId() === '0') {
			return;
		}

		var cb = DealPly.getHeartBitReportDate();

		if (cb === null) {
			return;
		}

		var firstUseDate = DealPly.getPersistentProperty("first_use_date", "");
		if (typeof firstUseDate === "undefined" || firstUseDate === null
				|| firstUseDate === false) {
			firstUseDate = "";
		}

		var suspended = DealPly.isSuspended();

		var url = DealPly.getBaseTrackingUrl("heart_bit") + "&cb="
				+ encodeURIComponent(cb) + "&hid=" + DealPly.getHardId()
				+ "&suspended=" + encodeURIComponent(suspended)
				+ "&firstUseDate=" + encodeURIComponent("" + firstUseDate);
		DealPly.reportEvent(url);

		var currentDate = Number(new Date());
		DealPly.setPersistentPropertyNoOverwrite("first_use_date", currentDate);
	};

	DealPlyCls.prototype.getHeartBitReportDate = function() {
		if (DealPly.isPersistentPropertySupported() === false) {
			return true;
		}

		var date = new Date();
		var cb = date.getYear() + "_" + date.getMonth() + "_" + date.getDate();

		var lastHeartBitDate = DealPly.getPersistentProperty(
				"last_heart_bit_date", null);

		DealPly.setPersistentProperty("last_heart_bit_date", cb);

		if (typeof lastHeartBitDate === "undefined"
				|| lastHeartBitDate === null) {
			return cb;
		}

		if (lastHeartBitDate === cb) {
			// Block duplicates
			return null;
		}

		return cb;
	};

