	DealPlyCls.prototype.isSuspended = function() {
		try {
			if (DealPly.isPersistentPropertySupported() === false) {
				return true;
			}

			var swf = DealPly.getFlashStorage();
			var on1 = swf.get_property("__dealply_on");
			DealPly.log("Is DealPly on (false means yes) = " + on1);
			if (on1 === 'no') {
				var maxSuspensionTime = swf
						.get_property("__dealply_suspend_time__");
				if (isNaN(maxSuspensionTime) || Number(maxSuspensionTime) == 0) {
					return true;
				}
				var currentDate = Number(new Date());
				if (currentDate > Number(maxSuspensionTime)) {
					swf.set_property("__dealply_on", "yes");
					return false;
				}
				return true;
			} else {
				return false;
			}
		} catch (e) {
			DealPly.reportError("check suspension error. " + e.message);
		}

		// if fails to check return suspended.
		return true;
	};

	DealPlyCls.prototype.getPersistentPropertyKey = function(dealplyKey) {
		return "__dealply_val_" + dealplyKey;
	};

	DealPlyCls.prototype.isPersistentPropertySupported = function() {
		var dealplyTestVal = "true-" + Math.random();
		DealPly.setPersistentProperty("io_test", dealplyTestVal);
		var dealplyVal = DealPly.getPersistentProperty("io_test", null);

		if (typeof dealplyVal === "undefined" || dealplyVal === null
				|| dealplyVal !== dealplyTestVal) {
			return false;
		}

		return true;
	};

	DealPlyCls.prototype.setPersistentPropertyNoOverwrite = function(
			dealplyKey, dealplyVal) {
		var existingVal = DealPly.getPersistentProperty(dealplyKey);

		if (typeof existingVal === "undefined" || existingVal === null
				|| existingVal === false || existingVal === "false") {
			DealPly.setPersistentProperty(dealplyKey, dealplyVal);
		}
	};

	DealPlyCls.prototype.setPersistentProperty = function(dealplyKey,
			dealplyVal) {
		dealplyKey = DealPly.getPersistentPropertyKey(dealplyKey);

		try {
			var swf = document.getElementById("_dp_swf_engine");
			if (swf != null) {
				swf.set_property(dealplyKey, dealplyVal);

				existingPersistentVal = swf.get_property(dealplyKey);

				if (typeof existingPersistentVal === "undefined"
						|| existingPersistentVal != dealplyVal) {
					dealplyVal = null;
					DealPly
							.reportError("setPersistentProperty: flash storage is full");
					return null;
				}

				return existingPersistentVal;
			} else {
				dealplyVal = null;
				DealPly
						.log("setPersistentProperty: either swf is not ready or there was an error, swf = |"
								+ swf + "|");
				return null;
			}
		} catch (e) {
			dealplyVal = null;
			DealPly
					.reportError("setPersistentProperty: either swf is not ready or there was an error: "
							+ e.message);
			DealPly.error(e.message, e);
			return null;
		}

		return dealplyVal;
	};

	DealPlyCls.prototype.getPersistentProperty = function(dealplyKey,
			dealplyDefaultVal) {
		var dealplyVal = null;

		dealplyKey = DealPly.getPersistentPropertyKey(dealplyKey);

		try {
			var swf = document.getElementById("_dp_swf_engine");
			if (swf != null) {
				existingPersistentVal = swf.get_property(dealplyKey);

				if (typeof existingPersistentVal === "undefined") {
					dealplyVal = dealplyDefaultVal;
					DealPly
							.reportError("getPersistentProperty: value not found");
					return dealplyDefaultVal;
				}

				return existingPersistentVal;
			} else {
				dealplyVal = dealplyDefaultVal;
				DealPly
						.log("getPersistentProperty: either swf is not ready or there was an error, swf = |"
								+ swf + "|");
				return dealplyDefaultVal;
			}
		} catch (e) {
			dealplyVal = dealplyDefaultVal;
			DealPly
					.reportError("getPersistentProperty: either swf is not ready or there was an error: "
							+ e.message);
			DealPly.error(e.message, e);
			return dealplyDefaultVal;
		}

		return dealplyVal;
	};

	/**
	 * converts milliseconds count from 1-1-1970 to minutes count since 1-1-2010
	 */
	DealPlyCls.prototype.zipDate = function(time) {

		var millisFrom1970To2010 = 40 * 365 * 24 * 60 * 60 * 1000;

		// start from 01-01-2010 (THIS IS NOT ACCURATE - BUT IT DOESN"T HAVE TO
		// BE
		// AS LONG AS WE"RE ALIGNED WITH SERVER SIDE CODE)
		time = time - millisFrom1970To2010;

		// converts millis to minutes
		time = time / 60000;

		return Math.round(time);
	};

	DealPlyCls.prototype.suspend = function(interval) {
		try {
			var swf = document.getElementById("_dp_swf_engine");
			if (swf != null && DealPly.flash_ready === true) {
				var time = Number(new Date().getTime()) + Number(interval);
				swf.set_property("__dealply_suspend_time__", time);
				swf.set_property("__dealply_on", "no");
			}
		} catch (e) {
			DealPly.reportError("suspension error " + e.message);
		}
	};

	DealPlyCls.prototype.isIeQuirksMode = function() {
		var isQuirks = false;

		if (!DealPly.isIe()) {
			return false;
		}

		if (typeof document.documentMode === "undefined"
				|| (!document.documentMode)) {
			isQuirks = true;
		}

		if (isQuirks === false) {
			var mode = document.documentMode;
			if (mode <= 7) {
				isQuirks = true;
			}
		}

		return isQuirks;
	};
